                <img src={require('../images/me.jpg')}></img>
                <div className="projectDesc">
                    <p>This is my face. It's a pretty face</p>
                </div>
            </div>
                <div className="techStack">
                    <h1>Tech Stack:</h1>
                    <div>
                    <i class="fa-brands fa-react"></i>
                    <i class="fa-brands fa-react"></i>
                    <i class="fa-brands fa-react"></i>
                    </div>
                </div>
        </div>
    )
}

export default Project;
